script: |
  super -f text -I q6383.spq | sort > q6383.out

inputs:
  - name: q6383.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NULL BETWEEN + - col2 + + + col0 * + + CAST ( - col2 AS REAL ) / 5 AND ( - 63 * + 61 );
  - name: tab0

outputs:
  - name: q6383.out
    data: |
